handlers:
- url: /favicon\.ico
  static_files: static/favicon.ico
  upload: static/favicon\.ico

- url: /touch\-icon\-(.*)\.png
  static_files: static/touch-icon-\1.png
  upload: static/touch\-icon\-(.*)\.png

- url: /static
  static_dir: static

- url: /(robots\.txt)
  static_files: static/\1
  upload: static/robots.txt

- url: /(google5ddcdcec3c24d2d5\.html)
  static_files: static/\1
  upload: static/google5ddcdcec3c24d2d5\.html
